import React, { Component } from 'react';
import Request from '../../helpers/request';
import PaddockBoxStatus from '../../components/park_view/PaddockBoxStatus';

class VisitorCount extends Component {
  constructor(props){
    super(props);
    this.state = {
      paddock1: [], paddock2: [], paddock3: [], paddock4: [], paddock5: [], paddock6: []
    }
  }

  componentDidMount(){
    const request = new Request();
    request.get("/paddocks/all").then((data) => {
        console.log(data.length);
        this.setState({paddock1: data[0]});
        this.setState({paddock2: data[1]});
        this.setState({paddock3: data[2]});
        this.setState({paddock4: data[3]});
        this.setState({paddock5: data[4]});
        this.setState({paddock6: data[5]});
        console.log(this.state);
    })
  }

  render() {
      return(
        <>
            <PaddockBoxStatus paddocks = {this.state.paddocks}/>
        </>
    );
  }
}

export default VisitorCount;
